import { Parallax } from "react-parallax";
import screen1 from '../Images/Monitor/Screen1.svg';

const screenOne = () => {
    <Parallax strength={200}>
        <img id="screen1" src={screen1} alt="screen1" />
    </Parallax>
}

export default ScreenOne;
